import React from "react";

const arara = () => (
    <div className="info">
        <h1>Arara Azul</h1>
        <p>A arara-azul é uma das aves mais icônicas e majestosas do mundo. Com uma plumagem predominantemente azul e detalhes em amarelo e verde, é uma espécie que chama atenção pela sua beleza exótica e imponência.
            Encontrada principalmente nas florestas tropicais da América do Sul, a arara-azul é uma ave social que vive em grupos e se alimenta de frutas, sementes e castanhas. Infelizmente, é uma espécie ameaçada de extinção devido à perda de habitat, caça e comércio ilegal.
            A conservação da arara-azul é fundamental para manter a biodiversidade e o equilíbrio dos ecossistemas. Diversas iniciativas de proteção e reintrodução da espécie têm sido realizadas, com resultados positivos. É importante conscientizar a população sobre a importância de preservar a fauna e a flora, para garantir um futuro sustentável para todos.</p>
    </div>
);

export default navBar;
